о',337,5,0),(20,'Арсенал','<p>Контактное лицо: Буняев Вячеслав +7 (915) 285 74 93</p>\r\n<p>Домашний зал: г.Электросталь ул.Советская д 21/6 институт МИСиС(МАМИ)</p>','0',0,'bl15054220771153.jpg','Всеволодово',339,1,0),(21,'Богородск','<p>Год основания команды 2011. Двукратные чемпионы НЛВЛ, сезон 2014-2015, сезон 2016-2017 гг.</p>','0',0,'bl15054247771492.jpg','Ногинск',340,0,0),(24,'Интрига','<p>Контактное лицо: Горская Ольга - +7-(903)-660-19-95</p>','0',131,'bl15059920242509.png','Павловский Посад',342,0,0),(25,'ВК\"Динамо\"','','0',0,'bl15056339942312.jpg','Ногинск',343,2,0),(28,'\"Жемчужина\"','<p>Контактное лицо : Агузова Анастасия : 8-926-492-36-69</p>\r\n<p>Соболева Наталья : 8-985-269-60-29</p>\r\n<p>Зал находиться по адресу : МО, Пушкинский район, поселок Зеленый городок. (в Костино), пансионат \"Салют\" </p>\r\n<p>Время зала: воскресенье 13:00-20.00</p>\r\n<p>Бронзовый призер сезона 2015-2016</p>\r\n<p>Серебряный призер сезона 2016-2017</p>','0',0,'bl15065181842150.jpg','Пушкино',345,0,0),(32,'Электросталь','<p>Домашние игры:</p>\r\n<p>День/Время   Понедельник/20.00</p>\r\n<p>Место   г.Электросталь, ул.Расковой, д.31, с/з \"Строитель\"</p>\r\n<p>К.л. Берберян Илья</p>\r\n<p>Тел. 8 926 733-67-69 </p>','0',0,'bl15064199602012.png','Электросталь',349,4,0),(33,'Семь ветров','','0',0,'bl15064210421750.png','Павловский Посад',350,0,0),(34,'Электроугли \"Виктория\"','<p>Контактное лицо:</p>\r\n<p>Паршина Наталья Владимировна 8 (916) 694-41-69</p>\r\n<p>Сочиеноков Денис Александрович 8 (926) 0180-18-15</p>\r\n<p>Домашний зал: г Электроугли ул.Парковая д.16 СК \"Виктория\"</p>\r\n<p>Дни и Время приема игр: Суббота 19:00</p>','0',236,'bl15063353392446.png','Электроугли',351,0,0),(35,'Лидер','','0',0,'bl15064075172379.jpg','Электросталь',352,0,0),(29,'ВК Павловский Посад','<p>Победители регулярного чемпионата НЛВЛ сезона 2016-2017&nbsp;</p>','0',0,'bl15057612682830.jpg','Павловский Посад',346,6,0),(30,'Литвиново','<p>Координатор команды - Светлана Ларионова Тел. 8-906-090-97-39</p>\r\n<p>Тренер команды - Сергей Иванович Ананьин Тел. 8-926-483-93-99</p>\r\n<p> </p>\r\n<p>Адрес домашнего зала: г. Щелково, ул. Краснознаменская, 24/1 (УСК \"Подмосковье\")</p>\r\n<p>День и время приема: восктесенье, 12-00 (разминка)</p>','0',0,'bl1506680411433.jpg','Литвиново',347,0,0),(31,'Молодежный центр \"Крылья\"','','0',0,'bl150668043514.jpg','Монино',348,0,0),(36,'Чкаловский','','0',0,'bl15066798251991.gif','Чкаловский',0,0,0);
