INSERT INTO `nog_content` VALUES (1,61,'Добро пожаловать на официальный сайт НЛВЛ!','main','<p style=\"font-size: 24px; color: #0066ff;\">Добро пожаловать на официальный сайт НЛВЛ!</p>\r\n<p style=\"font-size: 14px;\">Ногинская Любительская Волейбольная Лига берет свое начало в 2011г. когда пара обычных ребят, которые любили волейбол, пришла идея создать чемпионат и объединить близь лежащие города!</p>\r\n<p style=\"font-size: 14px;\">С этого времени началось становление и планирование НЛВЛ, и первым сезоном был 2012-2013г. В соревнованиях участвовали девять команд: Автоколонна ветераны (Ногинск), Автоколонна (Ногинск), Дельта (Ногинск), Богородск, Купавна, Черноголовка, Электросталь, Электроугли, Электрогорск. Чемпионат проходил при активной поддержке инициативной группы из представителей команд. Более восьми месяцев волейболисты сражались на площадках за звание Чемпиона соревнований. 8 июня 2013г. в селе Ямкино прошёл финал, в который попали четыре сильнейших команды. В напряженных встречах главный кубок завоевала команда Электросталь, на втором месте – Черноголовка, на третьем - Богородск, четвёртое место - Купавна. Призеры соревнований были награждены кубками, медалями. Лучшие игроки команд получили ценные призы. Чемпионат показал высокий уровень и продолжил свое развитие!&nbsp;</p>\r\n<p style=\"font-size: 14px;\">В новом сезоне 2013-2014г. Управлении по физической культуре, спорту, туризму и работе с молодёжью администрации Ногинского муниципального района активно подключается к проведению Чемпионата Ногинского района по волейболу и помогает развитию НЛВЛ (Ногинская Любительская&nbsp; Волейбольная&nbsp; Лига) Президентом которой назначается Байкин Сергей Витальевич, создается официальное положение и регламент. По завершению мужского Чемпионата, игроком команды Черноголовка, Косенко Александром,&nbsp; поступает предложение провести Чемпионат среди женщин, на что волейболистки с удовольствием откликнулись.</p>\r\n<p style=\"font-size: 14px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Чемпионат продолжил расти и в сезоне и в сезоне 2014-2015г. играли уже девять мужских и шесть женских команд, уровень повышался и количество команд тоже, так в сезоне 2015-2016г. уже было по десять команд у мужчин и женщин! У руля Чемпионата НЛВЛ незабвенно стояли так же Байкин Сергей Витальевич президент и вице-президент Свободин Андрей Анатольевич, которые много сделали для повышения уровня НЛВЛ!</p>\r\n<p style=\"font-size: 14px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; В сезоне 2016-2017г. у Чемпионата появилось Ветеранская лига в которой выступали пять команд, так же в этом сезоне появился сайт НЛВЛ. В новом сезоне 2017-2018г. который предстоит еще много улучшений, создается коллегия судей под предводительством Сырова Сергея Владимировича, новый протокол игр, а так же в Чемпионате ожидается очень высокий уровень игроков! Присоединяйтесь в коллектив единомышленников Ногинской Любительской Волейбольной Лиги!</p>','',1,8,'2013-11-16 00:00:00',313,'','2017-09-06 18:31:37',313,0,'0000-00-00 00:00:00','2013-11-16 00:00:00','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"article_layout\":\"\",\"show_title\":\"0\",\"link_titles\":\"0\",\"show_tags\":\"0\",\"show_intro\":\"0\",\"info_block_position\":\"\",\"info_block_show_title\":\"0\",\"show_category\":\"0\",\"link_category\":\"0\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',42,6,'','',1,10596,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',1,'ru-RU',''),(2,72,'Результаты Финалов Шести','rezultaty-finalov-shesti','<h2 style=\"margin: 1em 0px 0.8em; padding: 0px; border: 0px; outline: 0px; font-size: 1.5em; vertical-align: baseline; background: #fbfcfc; text-align: center; color: #525252 !important;\"><strong><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: transparent;\">Состоялись мужские и женские Финалы Шести НЛВЛ</span></strong></h2>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif; text-align: center;\"><strong>По результатам сформировались полуфиналисты:</strong></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\"><strong>Мужчины </strong></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\">Первая пара полуфиналистов \"Павловский-Посад\" <span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: transparent;\">Павловский-Посад - \"Гвозди\" Электросталь </span></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color