"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',6,4,'','',1,311,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'ru-RU',''),(8,98,'Коллегия судей','kollegiya-sudej','<p style=\"text-align: center;\">&nbsp;<strong style=\"font-size: 24px;\">\"</strong><strong style=\"font-size: 24px;\">Судейская коллегия \"НЛВЛ\"</strong></p>\r\n<p><strong>Обязанности судей.</strong></p>\r\n<p>Обязанности судей Лиги: прибытие за 30 минутна игру, контроль времени,&nbsp;проверка площадки на соответсвие стандартам, розыгрыш подачи, присутствие на официальной разминке,&nbsp;проверка игроков на соответствие заявке, ведение протокола от начала и до конца матча, после матчевая проверка протокола и отправка по WhatsApp в чат судей.&nbsp;</p>\r\n<p><strong><em>Судья на соревнованиях является официальным представителем НЛВЛ</em></strong>&nbsp;и несет полную ответственность за качество проведения соревнований.&nbsp;&nbsp;</p>\r\n<p>Спасибо за понимание, Желаем Всем 100% судейства без ошибок!</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong style=\"background-color: initial;\">ПРОТОКОЛ ИГР НОВЫЙ! ОБРАТИТЕ ВНИМАНИЕ!&nbsp;</strong></p>\r\n<p style=\"text-align: center;\">ПРОТОКОЛ ПЕЧАТАЕТСЯ НА ДВУХ СТОРОНАХ ОДНОГО ЛИСТА!</p>\r\n<p style=\"text-align: center;\"><a href=\"images/doc/1.jpg\">СКАЧАТЬ ПЕРВУЮ СТОРОНУ</a></p>\r\n<p style=\"text-align: center;\"><a href=\"images/doc/2.jpg\">СКАЧАТЬ ВТОРУЮ СТОРОНУ</a></p>\r\n<p style=\"text-align: center;\">Заполнение пример. Расписан на рельаной игре Московской области.&nbsp;</p>\r\n<p><img src=\"images/site/01.jpeg\" width=\"832\" height=\"585\" alt=\"01\" style=\"float: left;\" /></p>\r\n<p style=\"text-align: justify;\"><img src=\"images/site/02.jpeg\" width=\"826\" height=\"552\" alt=\"02\" style=\"float: left;\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left;\"><strong>&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>МЕТОДИЧЕСКАЯ ЛИТЕРАТУРА</strong></p>\r\n<p style=\"text-align: left;\"><a href=\"images/doc/2017-2020.pdf\">ПРАВИЛА СОРЕВНОВАНИЙ 2017-2020.pdf</a></p>\r\n<p style=\"text-align: left;\"><a href=\"images/doc/2017.pdf\">Руководство для судей и инструкции 2017.pdf</a></p>\r\n<p style=\"text-align: left;\"><a href=\"images/doc/FIVB-2016.pdf\">Книга прецедентов судейства FIVB 2016.pdf</a></p>\r\n<p style=\"text-align: left;\"><a href=\"images/doc/jest.doc\">Жесты судей в волейболе.docx</a></p>\r\n<p style=\"text-align: left;\"><a href=\"images/doc/1-2----.pdf\">Разъяснение для 1-2 судей по судейским жестам.pdf</a></p>\r\n<p>&nbsp;</p>','',1,8,'2017-07-30 16:49:26',313,'','2017-09-29 13:56:24',313,0,'0000-00-00 00:00:00','2017-07-30 16:49:26','0000-00-00 00:00:00','{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"float_intro\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\",\"float_fulltext\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',9,2,'','',1,332,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'ru-RU',''),(9,100,'26 августа собрание тренеров и семинар коллегии судей!','26-avgusta-sobranie-trenerov-i-seminar-kollegii-sudej','<p>&nbsp;</p>\r\n<p>Напоминаем что 26 августа в здании ДЮСШ по адресу г.Ногинск Нижегородская 30 в 12.00 по московскому времени, состоится совещание тренеров и координаторов команд тема: Cезон 2017-2018г. Читайте новость полностью.</p>\r\n','\r\n<p>&nbsp;</p>\r\n<p>Так же пройдет судейский семинар на котором должны быть все судьи которые хотят судить в сезоне 2017-2018г. В новом сезоне судейство будет оплачиваться, семинар будет так же платный 700р. которые пойдут на формирование фонда коллегии судей на непредвиденные ситуации.<br />С собой иметь паспорт, блокнот и ручку для записей, по окончанию семинара будет небольшой тест. Семинар будет проводить Сергей Сыров судья первой категории России. Ждем всех!</p>\r\n<p><img src=\"images/slider/3.png\" width=\"818\" height=\"282\" alt=\"3\" /></p>\r\n<p>&nbsp;</p>',1,9,'2017-08-23 12:10:02',313,'','2017-08-23 12:10:15',313,0,'0000-00-00 00:00:00','2017-08-23 12:10:02','0000-00-00 00:00:00','{\"image_intro\":\"images\\/03.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,4,'','',1,129,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'ru-RU',''),(10,102,'Новости! Последние изменения! ','novosti-poslednie-izmeneniya','<p style=\"text-align: center;\"><strong>Всем доброго времени суток НЛВЛ!</strong></p>\r\n<p style=\"text-align: center;\"><img src=\"images/logo_blue.jpg\" width=\"250\" height=\"109\" alt=\"logo blue\" /></p>\r\n<p>Доводим до сведения участников НЛВЛ.<br /><strong>Взнос за участие в чемпионате составляет 7000 рублей.</strong>&nbsp;<strong>Взнос необходимо оплатить не позже 15 октября!!!</strong></p>\r\n<p style=\"text-align: center;\">Последний <a href=\"images/doc/Polozhenie_LVL_2017-18_pererabotanny.doc\">РЕГЛАМЕНТ</a></p>\r\n<p style=\"text-align: center;\">&nbsp;ОБНОВИЛИ РАЗДЕЛ \"ДОКУМЕНТЫ\" - ВЫЛОЖИЛИ НОВЫЙ ПРОТОКОЛ!</p>\r\n<p>30 сентября 2017 г. Коллегия судей НЛВЛ проводит общее собрание и предсезонный семинар волейбольных судей.&nbsp;<br />Мероприятие пройдет в здании ДЮСШ, по адресу г. Ногинск ул. Нижегородская 30. ( адрес может поменяться, об этом будет проинформировано заранее). <strong>Начало в 10-00.</strong> Регистрация участников начинается в 09-30. <strong>Явка обязательна.</strong> Все кто не сможет присутствовать по каким-либо причинам, надо будет позвонить Сырову Сергею ( 89263467980 ), до 29 сентября.</p>\r\n<p>Участникам собрания и семинара при себе иметь:</p>\r\n<p>Лицензию<br />Не имеющим лицензию при себе иметь <strong>1 фото</strong> (3 х 4)</p>\r\n<p>Лицензия судьи на сезон 2017/2018 гг. — <strong>700 рублей</strong></p>\r\n<p style=\"text-align: center;\"><img src=\"images/News/ty67-AK6_7E.jpg\" width=\"225\" height=\"225\" alt=\"ty67 AK6 7E\" /></p>\r\n<p><strong>Предварительно заявленные команды:</strong></p>\r\n<p>Мужские: Богородск, Электросталь, Электроугли, Электрогорск, Гвозди, Семь Ветров, Павловский-Посад, Всеволодово!&nbsp;</p>\r\n<p>Женские: Агат, Крылья, Жемчужина, Чкаловский, Электросталь, Электроугли, Черноголовка, Павловский-Посад, Юность, Литвиново, Медвежьи Озера и еще одна Электросталь!&nbsp;</p>\r\n<p>&nbsp;</p>','',1,9,'2017-09-05 19:46:18',313,'','2017-09-05 20:17:49',313,0,'0000-00-00 00:00:00','2017-09-05 20:02:13','0000-00-00 00:00:00','{\"image_intro\":\"images\\/News\\/ty67-AK6_7E.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',5,3,'','',1,198,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'ru-RU',''),(11,109,'Инструкция как подать заявку на участие в НЛВЛ!','instruktsiya-kak-podat-zayavku-na-uchastie-v-nlvl','<p style=\"text-align: center;\"><strong>Инструкция в формате</strong>&nbsp;<a href=\"images/doc/rega.doc\">DOC</a>&nbsp;</p>\r\n<p>&nbsp;</p>','',1,9,'2017-09-12 10:09:03',313,'','2017-09-12 10:09:03',0,0,'0000-00-00 00:00:00','2017-09-12 10:09:03','0000-00-00 00:00:00','{\"image_intro\":\"images\\/info.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,2,'','',1,122,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'ru-RU',''),(12,111,'Новости НЛВЛ - Закрыт прием заявок! Начало игр 7-8 октября! ','novosti-nlvl-zakryt-priem-zayavok','<p style=\"font-size: small; text-align: center;\"><strong style=\"font-size: 16px;\">Добрый день НЛВЛовцы!</strong></p>\r\n<p>Закрыта заявочная компания в Нашей лиге на сезон 2017-2018г. в итоге вышло 10 мужских команд и 11 женских, что не может не радовать, потому как планку ставили 12 максимум и то уже много.</p>\r\n<table style=\"width: 825px; height: 463px;\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"images/News/Screenshot_1.png\" width=\"403\" height=\"411\" alt=\"Screenshot 1\" /><img src=\"images/News/Screenshot_2.png\" width=\"408\" height=\"399\" alt=\"Screenshot 2\" /></td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Мужская заявочная компания прошла достаточно ровно и без сложностей. <span style=\"text-decoration: underline;\">Ждем только фотографии игроков от команды \"Эколаб\" Электрогорск.</span>&nbsp;</p>\r\n<p>Женская заявочная компания до сих пор оставляет много недочетов, хочу обратить внимание:</p>\r\n<p>1.Команда Черноголовка прошу выслать список игроков на почту <a href=\"mailto:info@noginsk-volley.ru\">info@noginsk-volley.ru</a>&nbsp;;</p>\r\n<p>2.Команда Nika Ногинск ждем фото игроков;</p>\r\n<p>3.Хотелось бы чтоб все команды женские подгрузили логотипы, хотя бы обычные гербы муниципалитетов или предприятий;</p>\r\n<p>4.Чкаловский на сайте нет регистрации, необходимо добавить, на почту пришла заявка;</p>\r\n<p>5.Лидер Электросталь нет заявки на почте, ждем в ближайщее время.</p>\r\n<p>6.Команда Женская \"Семь Ветров\" выслать фото Гладаловой Вероники</p>\r\n<p><strong>Всем командам так же необходимо внести в поле информация о команде (см.на скриншоте ниже) Данные контактных лиц, адрес зала и время приема домашних игр.</strong>&nbsp;</p>\r\n<p>На основе этих данных сформирует контактный лист команд! <span style=\"text-decoration: underline;\">Так же всем желательно проверить свои заявки на сайте, потому как были заявки одного игрока в разные команды.</span></p>\r\n<p><img src=\"images/News/Screenshot_3.png\" width=\"596\" height=\"605\" alt=\"Screenshot 3\" />&nbsp;</p>\r\n<p style=\"font-size: 16px;\">&nbsp;<strong>О взносах оплатить необходимо до 15 октября 2017г. по оплате обращаться к Свободину Андрею лично по телефону&nbsp;+7(968)979-02-49&nbsp;</strong></p>\r\n<p>Расписание на первый тур почти готово и будет опубликованно в ближайщее время! <span style=\"text-decoration: underline;\">Было бы раньше если так долго не тянули с заявками!</span></p>\r\n<p><strong>НАЧАЛО ИГР НЛВЛ 7-8 октября!!!</strong> Планируем свое время! С переносами в этом году все будет жестче! Читайте в положении.&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"images/News/2Qag72H.jpg\" width=\"526\" height=\"370\" alt=\"2Qag72H\" /></p>\r\n<p style=\"text-align: center;\"><strong>30 сентября 2017 г. Коллегия судей НЛВЛ проводит общее собрание и предсезонный семинар волейбольных судей.&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Мероприятие пройдет в здании ДЮСШ, по адресу г. Ногинск ул. Нижегородская 30. ( адрес может поменяться, об этом будет проинформировано заранее). Начало в 10-00. Регистрация участников начинается в 09-30. Явка обязательна. Все кто не сможет присутствовать по каким-либо причинам, надо будет позвонить Сырову Сергею ( 89263467980 ), до 29 сентября.&nbsp;</p>\r\n<p>Участникам собрания и семинара при себе иметь:&nbsp;</p>\r\n<p>Лицензию&nbsp;<br />Не имеющим лицензию при себе иметь 1 фото (3 х 4)</p>\r\n<p>Судейский инвентарь свистки, карточки.&nbsp;</p>\r\n<p>Лицензия судьи на сезон 2017/2018 гг. — <strong>700 рублей&nbsp;</strong><br />Так же вы сможете приобрести комплект правил и руководств к ним за 500 рублей.&nbsp;<br /><span style=\"text-decoration: underline;\">После семинара все желающие приглашаются на женский турнир, где вы сможете получить практику судейства. (время и место сообщу на месте).</span></p>\r\n<p>Рекомендуем всем отправить на курсы судью от своей команды, своими силами судит в этом году будет <strong>нельзя! </strong>Оплата судейства так же в этом году <strong>обязательна</strong>! 700 рублей игра!</p>\r\n<p style=\"text-align: center;\">&nbsp;<strong>Всем спасибо!!!</strong>&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"images/03.jpg\" width=\"250\" height=\"109\" alt=\"03\" /></p>','',1,9,'2017-09-26 11:28:14',313,'','2017-09-26 11:32:48',313,0,'0000-00-00 00:00:00','2017-09-26 11:32:48','