uthor\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'ru-RU',''),(15,115,'Опубликовано расписание игр на первый круг НЛВЛ','opublikovano-raspisanie-igr-na-pervyj-krug-nlvl','<p style=\"text-align: center;\"><img src=\"images/News/Bg-obu0nMOs.jpg\" width=\"138\" height=\"179\" alt=\"Bg obu0nMOs\" /></p>\r\n<p style=\"text-align: center;\"><strong style=\"font-size: 16px;\">Доброго времени суток!</strong></p>\r\n<p>Опубликовали расписание мужских и женских игр на первый круг сезона 2017-2018г. НЛВЛ. Женщины начинают 7-8 Октября, мужчины 14-15 октября. По запросам добавили отдельный пункт меню \"Календарь\", так же в календарь можно выйти сразу из турнирной таблицы, нажав сверху кнопку \"Календарь\".&nbsp;</p>\r\n<p><img src=\"images/News/ig_1.png\" width=\"594\" height=\"257\" alt=\"ig 1\" /><img src=\"images/News/ig_2.png\" width=\"456\" height=\"258\" alt=\"ig 2\" /></p>\r\n<p><span style=\"text-decoration: underline;\">Обратите внимание</span>&nbsp;в женской лиге 11 команд, и к каждый тур одна команда отдыхает, соответственно <strong>нет</strong> ее в расписании!</p>\r\n<p>Очень удобно стало смотреть игры своей команды, надо только перейти в ее профиль и выбрать вкладку \"Матчи\" см. скриншот ниже.</p>\r\n<p><img src=\"images/News/rs_1.png\" width=\"537\" height=\"382\" alt=\"rs 1\" />&nbsp;</p>\r\n<p style=\"color: #db0a33;\">Все \"активно\" внесли информацию о командах, залах и время приема игр, поэтому всем кто не предоставил информацию было проставленно Суббота и 12.00 прием игр! Исправить это можно модераторам команд своими силами, надо только авторизоваться на сайте и зайти в раздел своей команды и открыть пункт \"Игровой день\" и там изменить дату и время.</p>\r\n<p><img src=\"images/News/igrdt_1.png\" width=\"899\" height=\"394\" alt=\"igrdt 1\" /></p>\r\n<p>Если нажать в разделе \"Игровой день\" на ссылку \"Детали матча\" то будет полная картина по этой игре, где можно добавить статистику, проставить игроков которые были на игре, загрузить фотографии матча! На свое усмотрение изучите и ведите этот раздел. Статистика будет отображаться в разных блоках сайта. &nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Всем женским командам у кого не было логотипа добавили его на свой вкус, его так же можно поменять в разделе модерации своей команды, где опять же <strong>повторяем</strong> надо заполнить информацию о команде, время, дата приема и домашний зал адрес, контактное лицо команды. Там же можно создать галерею своей команды подгрузив фотографии в нижнем блоке. Спасибо</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\">Проверьте свои заявки на сайте</span>, есть игроки зарегистрированные и не зачисленные в команды или заявленные два раза в разные команды: Баранов Артур, Желтухина Анна, Клементьев Андрей, Ларионова Светлана, Торопченкова Елизавета. &nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<strong>Напоминаем о семинаре судей завтра в субботу&nbsp;30 сентября 2017 г. ЯВКА обязательна,</strong> иначе не будет допуска судить игры!</p>\r\n<p>Участникам собрания и семинара при себе иметь:&nbsp;</p>\r\n<p>Лицензию&nbsp;<br />Не имеющим лицензию при себе иметь 1 фото (3 х 4)&nbsp;</p>\r\n<p>Лицензия судьи на сезон 2017/2018 гг. — 700 рублей&nbsp;<br />Так же вы сможете приобрести комплект правил и руководств к ним за 500 рублей.&nbsp;<br />После семинара все желающие приглашаются на женский турнир, где вы сможете получить практику судейства. (время и место сообщу на месте).</p>\r\n<p>&nbsp;</p>\r\n<p>Очень бы хотелось чтоб Игроки Лиги больше учавствовали в жизни НЛВЛ, скидывайте фотографии и видео в группу в ВК(создадим раздел медиа на сайте где опубликуем лучшее), делайте стримы с игр, предлагайте разные идеи, может завести Инстаграмм для НЛВЛ?! делать анонсы перед каждым туром, красивые баннеры принципиальных игр! Нам в команде не хватает творческих людей, присоединяйтесь!!! Будем рады!=)</p>\r\n<p style=\"text-align: center;\"><img src=\"images/03.jpg\" width=\"250\" height=\"109\" alt=\"03\" /></p>\r\n<p style=\"text-align: center;\"><strong style=\"font-size: 18px; color: #f53d41;\">Спасибо за внимание! Удачного старта Чемпионата!&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><img src=\"images/News/start.png\" width=\"374\" height=\"195\" alt=\"start\" /></p>\r\n<p>&nbsp;</p>','',1,9,'2017-09-29 15:12:13',313,'','2017-10-02 17:19:56',313,0,'0000-00-00 00:00:00','2017-09-29 15:12:13','0000-00-00 00:00:00','{\"image_intro\":\"images\\/info.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"article_layout\":\"_:default\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"0\",\"link_author\":\"0\",\"show_create_date\":\"0\",\"show_modify_date\":\"0\",\"show_publish_date\":\"0\",\"show_item_navigation\":\"0\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"0\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,'','',1,163,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'ru-RU','');
