INSERT INTO `nog_ucm_content` VALUES (2,'com_content.article','Результаты Финалов Шести','rezultaty-finalov-shesti','<h2 style=\"margin: 1em 0px 0.8em; padding: 0px; border: 0px; outline: 0px; font-size: 1.5em; vertical-align: baseline; background: #fbfcfc; text-align: center; color: #525252 !important;\"><strong><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: transparent;\">Состоялись мужские и женские Финалы Шести НЛВЛ</span></strong></h2>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif; text-align: center;\"><strong>По результатам сформировались полуфиналисты:</strong></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\"><strong>Мужчины </strong></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\">Первая пара полуфиналистов \"Павловский-Посад\" <span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: transparent;\">Павловский-Посад - \"Гвозди\" Электросталь </span></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\"><em>Начало игры 22 апреля в 10.00</em></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: transparent;\">Вторая пара полуфиналистов \"Богородск\" Ногинск - \"Электроугли\" </span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: transparent;\">Электроугли </span></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\"><em style=\"font-size: 12.96px;\">Начало игры 22 апреля в 12.00</em></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\"><em style=\"font-size: 12.96px;\"> </em></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\"><strong>Женщины </strong></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: transparent;\">Первая пара полуфиналистов \"Жемчужина\" Пушкино - \"Интрига\" </span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: transparent;\">Павловский-Посад</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: transparent;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\"><em style=\"font-size: 12.96px;\">Начало игры 22 апреля в 15.00</em></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: transparent;\">Вторая пара полуфиналистов \"Литвиново\" </span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: transparent;\">Литвиново - \"Агат\" Ногинск</span></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\"><em style=\"font-size: 12.96px;\">Начало игры 22 апреля в 17.00</em></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\"><em style=\"font-size: 12.96px;\"> </em></p>\r\n<p style=\"margin: 0px; padding: 0px 0px 0.8em; border: 0px; outline: 0px; font-size: 12.96px; vertical-align: baseline; background: #fbfcfc; color: #666666; font-family: Arial, Helvetica, sans-serif;\"><em style=\"font-size: 12.96px;\">Игры будут проходить </em><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background: transparent; font-family: tahoma, arial, verdana, sans-serif, \'Lucida Sans\'; text-align: right;\">г.Ногинск </span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background: transparent; text-align: right; font-family: tahoma, arial, verdana, sans-serif, \'Lucida Sans\'; line-height: 16.5px;\">ДДЮТ ул. III </span><span s