rls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',313,'','2017-08-22 15:48:00',313,'2017-08-22 18:25:43','ru-RU','2017-08-22 15:48:00','0000-00-00 00:00:00',4,96,'{\"image_intro\":\"images\\/info.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}',27,12,2,'','',9,'',1),(4,'com_content.article','26 августа собрание тренеров и семинар коллегии судей!','26-avgusta-sobranie-trenerov-i-seminar-kollegii-sudej','<p>&nbsp;</p>\r\n<p>Напоминаем что 26 августа в здании ДЮСШ по адресу г.Ногинск Нижегородская 30 в 12.00 по московскому времени, состоится совещание тренеров и координаторов команд тема: Cезон 2017-2018г. Читайте новость полностью.</p>\r\n',1,'0000-00-00 00:00:00',0,1,'{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',313,'','2017-08-23 12:10:02',313,'2017-08-23 12:10:15','ru-RU','2017-08-23 12:10:02','0000-00-00 00:00:00',9,101,'{\"image_intro\":\"images\\/03.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}',0,2,0,'','',9,'',1),(5,'com_content.article','Новости! Последние изменения! ','novosti-poslednie-izmeneniya','<p style=\"text-align: center;\"><strong>Всем доброго времени суток НЛВЛ!</strong></p>\r\n<p style=\"text-align: center;\"><img src=\"images/logo_blue.jpg\" width=\"250\" height=\"109\" alt=\"logo blue\" /></p>\r\n<p>Доводим до сведения участников НЛВЛ.<br /><strong>Взнос за участие в чемпионате составляет 7000 рублей.</strong>&nbsp;<strong>Взнос необходимо оплатить не позже 15 октября!!!</strong></p>\r\n<p style=\"text-align: center;\">Последний <a href=\"images/doc/Polozhenie_LVL_2017-18_pererabotanny.doc\">РЕГЛАМЕНТ</a></p>\r\n<p style=\"text-align: center;\">&nbsp;ОБНОВИЛИ РАЗДЕЛ \"ДОКУМЕНТЫ\" - ВЫЛОЖИЛИ НОВЫЙ ПРОТОКОЛ!</p>\r\n<p>30 сентября 2017 г. Коллегия судей НЛВЛ проводит общее собрание и предсезонный семинар волейбольных судей.&nbsp;<br />Мероприятие пройдет в здании ДЮСШ, по адресу г. Ногинск ул. Нижегородская 30. ( адрес может поменяться, об этом будет проинформировано заранее). <strong>Начало в 10-00.</strong> Регистрация участников начинается в 09-30. <strong>Явка обязательна.</strong> Все кто не сможет присутствовать по каким-либо причинам, надо будет позвонить Сырову Сергею ( 89263467980 ), до 29 сентября.</p>\r\n<p>Участникам собрания и семинара при себе иметь:</p>\r\n<p>Лицензию<br />Не имеющим лицензию при себе иметь <strong>1 фото</strong> (3 х 4)</p>\r\n<p>Лицензия судьи на сезон 2017/2018 гг. — <strong>700 рублей</strong></p>\r\n<p style=\"text-align: center;\"><img src=\"images/News/ty67-AK6_7E.jpg\" width=\"225\" height=\"225\" alt=\"ty67 AK6 7E\" /></p>\r\n<p><strong>Предварительно заявленные команды:</strong></p>\r\n<p>Мужские: Богородск, Электросталь, Электроугли, Электрогорск, Гвозди, Семь Ветров, Павловский-Посад, Всеволодово!&nbsp;</p>\r\n<p>Женские: Агат, Крылья, Жемчужина, Чкаловский, Электросталь, Электроугли, Черноголовка, Павловский-Посад, Юность, Литвиново, Медвежьи Озера и еще одна Электросталь!&nbsp;</p>\r\n<p>&nbsp;</p>',1,'0000-00-00 00:00:00',0,1,'{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',313,'','2017-09-05 19:46:18',313,'2017-09-05 20:17:49','ru-RU','2017-09-05 20:02:13','0000-00-00 00:00:00',10,103,'{\"image_intro\":\"images\\/News\\/ty67-AK6_7E.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}',1,5,0,'','',9,'',1),(6,'com_content.article','Документы','doc','<p style=\"text-align: center;\">&nbsp;</p>\r\n<p><img src=\"images/logo_blue.jpg\" width=\"250\" height=\"109\" alt=\"logo blue\" style=\"display: block; margin-left: auto; margin-right: auto;\" /></p>\r\n<p style=\"text-align: center;\"><strong>НОВОЕ ПОЛОЖЕНИЕ НЛВЛ НА СЕЗОН 2017-2018г.</strong></p>\r\n<p style=\"text-align: center;\"><strong><a href=\"images/doc/Polozhenie_LVL_2017-18_pererabotanny.doc\">Положение НЛВЛ 2017-18.doc</a><a href=\"http://i.noginsk-volley.ru/u/65/dbb3501cf711e6b9c6df4afa9b8577/-/%D0%9F%D0%BE%D0%BB%D0%BE%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5%20%D0%9D%D0%9B%D0%92%D0%9B%202016-17.doc\"><br /></a></strong></p>\r\n<p style=\"text-align: center;\">Положение можно скачать в формате DOC по ссылке выше.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><a href=\"images/doc/zayavka.doc\"><strong>Заявка на сезон 2017-18 Скачать</strong></a></p>\r\n<p style=\"text-align: center;\">Положение можно скачать в формате DOC по ссылке выше.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong style=\"color: #ef2915;\">ПРОТОКОЛ ИГР НОВЫЙ! ОБРАТИТЕ ВНИМАНИЕ!&nbsp;</strong></p>\r\n<p style=\"text-align: center;\">ПРОТОКОЛ ПЕЧАТАЕТСЯ НА ДВУХ СТОРОНАХ ОДНОГО ЛИСТА!</p>\r\n<p style=\"text-align: center;\"><a href=\"images/doc/1.jpg\">СКАЧАТЬ ПЕРВУЮ СТОРОНУ</a></p>\r\n<p style=\"text-align: center;\"><a href=\"images/doc/2.jpg\">СКАЧАТЬ ВТОРУЮ СТОРОНУ</a></p>\r\n<p style=\"text-align: center;\">Можно скачать по ссылке выше в формате .JPEG</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>АНКЕТА СУДЬИ</strong></p>\r\n<p style=\"text-align: center;\"><strong><a href=\"images/doc/Anketa.doc\">Анкета СУДЬИ.doc</a><a href=\"http://i.noginsk-volley.ru/u/2e/d96d502c2b11e6b08c9eeca76635a4/-/%D0%90%D0%BD%D0%BA%D0%B5%D1%82%D0%B0%20%D0%A1%D0%A3%D0%94%D0%AC%D0%98.doc\"><br /></a></strong></p>\r\n<p style=\"text-align: center;\">Можно скачать в формате DOC по ссылке выше.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>ЗАЯВЛЕНИЕ ИГРОКА НА ПЕРЕХОД</strong></p>\r\n<p style=\"text-align: center;\"><strong><a href=\"images/doc/perehod.doc\">ЗАЯВЛЕНИЕ ИГРОКА НА ПЕРЕХОД.doc</a></strong></p>\r\n<p style=\"text-align: center;\">Можно скачать в формате DOC по ссылке выше.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;Предложения и замечания можно оставить в официальной группе ВКонтакте:</p>\r\n<p style=\"text-align: center;\"><a href=\"https://vk.com/noginsk_volley\" rel=\"nofollow\">https://vk.com/noginsk_volley</a></p>\r\n<p style=\"text-align: center;\">или с оргкомитетом по телефону или лично.</p>\r\n<p style=\"text-align: center;\">Контакты Оргкомитета смотрите по ссылке&nbsp;</p>\r\n<p style=\"text-align: center;\"><a href=\"index.php/o-lige.html\">http://noginsk-volley.ru/about</a></p>\r\n<p style=\"text-align: center;\">ДАННЫЙ РАЗДЕЛ БУДЕТ ПОПОЛНЯТЬСЯ ОФИЦИАЛЬНЫМИ ДОКУМЕНТАМИ</p>\r\n<p style=\"text-align: center;\">НЕ ЗАБЫВАЕМ ПРОСМАТРИВАТЬ!&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>',1,'0000-00-00 00:00:00',0,1,'{\"article_layout\":\"\",\"show_title\":\"0\",\"link_titles\":\"0\",\"show_intro\":\"0\",\"show_category\":\"0\",\"link_category\":\"0\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"0\",\"link_author\":\"0\",\"show_create_date\":\"0\",\"show_modify_date\":\"0\",\"show_publish_date\":\"0\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"0\",\"show_hits\":\"0\",\"show_noauth\":\"0\",\"alternative_readmore\":\"\",\"show_publishing_options\":\"0\",\"show_article_options\":\"0\",\"show_urls_images_backend\":\"0\",\"show_urls_images_frontend\":\"0\"}',0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',313,'','2017-07-08 15:51:44',313,'2017-09-06 13:55:16','ru-RU','2017-07-08 15:51:44','0000-00-00 00:00:00',5,104,'{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}',115,18,3,'','',8,'',1),(7,'com_content.article','Инструкция как подать заявку на участие в НЛВЛ!','instruktsiya-kak-podat-zayavku-na-uchastie-v-nlvl','<p style=\"text-align: center;\"><strong>Инструкция в формате</strong>&nbsp;<a href=\"images/doc/rega.doc\">DOC</a>&nbsp;</p>\r\n<p>&nbsp;</p>',1,'0000-00-00 00:00:00',0,1,'{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',313,'','2017-09-12 10:09:03',0,'2017-09-12 10:09:03','ru-RU','2017-09-12 10:09:03','0000-00-00 00:00:00',11,110,'{\"image_intro\":\"images\\/info.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}',0,1,0,'','',9,'',1),(8,'com_content.article','Опубликовано расписание игр на первый круг НЛВЛ','opublikovano-raspisanie-igr-na-pervyj-krug-nlvl','<p style=\"text-align: center;\"><img src=\"images/News/Bg-obu0nMOs.jpg\" width=\"138\" height=\"179\" alt=\"Bg obu0nMOs\" /></p>\r\n<p style=\"text-align: center;\"><strong style=\"font-size: 16px;\">Доброго времени суток!</strong></p>\r\n<p>Опубликовали расписание мужских и женских игр на первый круг сезона 2017-2018г. НЛВЛ. Женщины начинают 7-8 Октября, мужчины 14-15 октября. По запросам добавили отдельный пункт меню \"Календарь\", так же в календарь можно выйти сразу из турнирной таблицы, нажав сверху кнопку \"Календарь\".&nbsp;</p>\r\n<p><img src=\"images/News/ig_1.png\" width=\"594\" height=\"257\" alt=\"ig 1\" /><img src=\"images/News/ig_2.png\" width=\"456\" height=\"258\" alt=\"ig 2\" /></p>\r\n<p><span style=\"text-decoration: underline;\">Обратите внимание</span>&nbsp;в женской лиге 11 команд, и к каждый тур одна команда отдыхает, соответственно <strong>нет</strong> ее в расписании!</p>\r\n<p>Очень удобно стало смотреть игры своей команды, надо только перейти в ее профиль и выбрать вкладку \"Матчи\" см. скриншот ниже.</p>\r\n<p><img src=\"images/News/rs_1.png\" width=\"537\" height=\"382\" alt=\"rs 1\" />&nbsp;</p>\r\n<p style=\"color: #db0a33;\">Все \"активно\" внесли информацию о командах, залах и время приема игр, поэтому всем кто не предоставил информацию было проставленно Суббота и 12.00 прием игр! Исправить это можно модераторам команд своими силами, надо только авторизоваться на сайте и зайти в раздел своей команды и открыть пункт \"Игровой день\" и там изменить дату и время.</p>\r\n<p><img src=\"images/News/igrdt_1.png\" width=\"899\" height=\"394\" alt=\"igrdt 1\" /></p>\r\n<p>Если нажать в разделе \"Игровой день\" на ссылку \"Детали матча\" то будет полная картина по этой игре, где можно добавить статистику, проставить игроков которые были на игре, загрузить фотографии матча! На свое усмотрение изучите и ведите этот раздел. Статистика будет отображаться в разных блоках сайта. &nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Всем женским командам у кого не было логотипа добавили его на свой вкус, его так же можно поменять в разделе модерации своей команды, где опять же <strong>повторяем</strong> надо заполнить информацию о команде, время, дата приема и домашний зал адрес, контактное лицо команды. Там же можно создать галерею своей команды подгрузив фотографии в нижнем блоке. Спасибо</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\">Проверьте свои заявки на сайте</span>, есть игроки зарегистрированные и не зачисленные в команды или заявленные два раза в разные команды: Баранов Артур, Желтухина Анна, Клементьев Андрей, Ларионова Светлана, Торопченкова Елизавета. &nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<strong>Напоминаем о семинаре судей завтра в субботу&nbsp;30 сентября 2017 г. ЯВКА обязательна,</strong> иначе не будет допуска судить игры!</p>\r\n<p>Участникам собрания и семинара при себе иметь:&nbsp;</p>\r\n<p>Лицензию&nbsp;<br />Не имеющим лицензию при себе иметь 1 фото (3 х 4)&nbsp;</p>\r\n<p>Лицензия судьи на сезон 2017/2018 гг. — 700 рублей&nbsp;<br />Так же вы сможете приобрести комплект правил и руководств к ним за 500 рублей.&nbsp;<br />После семинара все желающие приглашаются на женский турнир, где вы сможете получить практику судейства. (время и место сообщу на месте).</p>\r\n<p>&nbsp;</p>\r\n<p>Очень бы хотелось чтоб Игроки Лиги больше учавствовали в жизни НЛВЛ, скидывайте фотографии и видео в группу в ВК(создадим раздел медиа на сайте где опубликуем лучшее), делайте стримы с игр, предлагайте разные идеи, может завести Инстаграмм для НЛВЛ?! делать анонсы перед каждым туром, красивые баннеры принципиальных игр! Нам в команде не хватает творческих людей, присоединяйтесь!!! Будем рады!=)</p>\r\n<p style=\"text-align: center;\"><img src=\"images/03.jpg\" width=\"250\" height=\"109\" alt=\"03\" /></p>\r\n<p style=\"text-align: center;\"><strong style=\"font-size: 18px; color: #f53d41;\">Спасибо за внимание! Удачного старта Чемпионата!&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><img src=\"images/News/start.png\" width=\"374\" height=\"195\" alt=\"start\" /></p>\r\n<p>&nbsp;</p>',1,'0000-00-00 00:00:00',0,1,'{\"article_layout\":\"_:default\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"0\",\"link_author\":\"0\",\"show_create_date\":\"0\",\"show_modify_date\":\"0\",\"show_publish_date\":\"0\",\"show_item_navigation\":\"0\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"0\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',313,'','2017-09-29 15:12:13',313,'2017-10-02 17:19:56','ru-RU','2017-09-29 15:12:13','0000-00-00 00:00:00',15,116,'{\"image_intro\":\"images\\/info.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}',65,2,0,'','',9,'',1);
